// Scrapper Functions

async function webScraper(url) {

    try {

        let data = await axios.get(`http://api.scraperapi.com/?api_key=${Scraper_API_KEY}&url=${url}`)
        const $ = cheerio.load(data.data);

        var text = $($('script')).text();
        var FirstResult = findTextAndReturnRemainder(text, "var objCombinedBar =");
        var SecondResult = findTextAndReturnRemainder(text, "var obj =");
        var ThirdResult = findTextAndReturnRemainderThird(text, "var obj =");

        let FirstResultArr = []

        FirstResultArr.push(PullArr(FirstResult, 4))
        FirstResultArr.push(PullArr(FirstResult, 6))

        let SecondResultArr = []

        SecondResultArr.push(PullArr(SecondResult, 4))
        SecondResultArr.push(PullArr(SecondResult, 6))

        let ThirdResultArr = []

        ThirdResultArr.push(PullArr(ThirdResult, 4))
        ThirdResultArr.push(PullArr(ThirdResult, 6))

        if (FirstResultArr.includes("Not Found") || SecondResultArr.includes("Not Found") || ThirdResultArr.includes("Not Found")) {
            throw new Error('Pull Arr Function Return Not Found');
        }

        return { MainFPS: FirstResultArr, ProcessorFPS: SecondResultArr, GraphicFPS: ThirdResultArr }

    } catch (error) {
        console.log(error);
        SendErrorEmail("WebScraper", error, url)
        return "Error"
    }

};

function findTextAndReturnRemainder(target, variable) {
    try {
        var chopFront = target.substring(target.search(variable) + variable.length, target.length);
        var result = chopFront.substring(0, chopFront.search(";"));

        return result;

    } catch (error) {
        console.log(error);
        SendErrorEmail("FindText", error, "no")
        return "Error"
    }
}
function findTextAndReturnRemainderThird(target, variable) {
    try {
        var chopFront = target.substring(getPosition(target, variable, 2) + variable.length, target.length);
        var result = chopFront.substring(0, chopFront.search(";"));

        return result;

    } catch (error) {
        console.log(error);
        SendErrorEmail("FindText", error, "no")
        return "Error"
    }
}

function getPosition(string, subString, index) {
    return string.split(subString, index).join(subString).length;
}

function PullArr(text, number) {
    try {
        let newSubStr = text.split("\n")
        newSubStr = newSubStr[number]
        newSubStr = newSubStr.slice(0, -1);
        newSubStr = JSON.parse(newSubStr)
        newSubStr = ChangeFPSValuebySomePercent(newSubStr)

        return newSubStr

    } catch (error) {
        console.log(error);
        SendErrorEmail("PullArr", error, "Need Update")
        return "Not Found"
    }
}

function ChangeFPSValuebySomePercent(arr) {
    let FPSArr = []
    for (let i = 0; i < arr.length; i++) {
        let FPS = 0
        if (arr[i] < 100) {
            FPS = SetPercent(arr[i], 0.10)
        } else {
            let value = arr[i]
            value = parseFloat(value) + 2
            FPS = SetPercent(value, 0.05)
        }

        FPSArr.push(FPS)

    }

    return FPSArr
}

function SetPercent(number, percent) {
    return ((number * percent) / 100) + number
}

